import React from 'react';
import {
  Container,
  Logo,
  NavContainer,
  NavLink,
  NavItemText,
  NavLogInText,
  NavSignUp,
  NavSignUpText,
  NavMenu,
} from './styles';

interface Props {
  minimalist?: boolean;
}

const Header: React.FC<Props> = ({ minimalist = false }) => {
  return (
    <Container>
      <NavContainer>
        <Logo>Supply Me</Logo>
        <NavMenu>
          {!minimalist && (
            <>
              <NavLink to="">
                <NavItemText>How it works?</NavItemText>
              </NavLink>
              <NavLink to="">
                <NavLogInText>Log In</NavLogInText>
              </NavLink>
            </>
          )}
          <NavLink to="">
            <NavSignUp>
              <NavSignUpText>Become a Partner</NavSignUpText>
            </NavSignUp>
          </NavLink>
        </NavMenu>
      </NavContainer>
    </Container>
  );
};

export default Header;
